import React from "react";

const TransactionTable = () => {
    return (
        <div>
        <table id="transaction-table">
          <thead>
            <tr>
              <th>Description</th>
              <th>Type</th>
              <th>Amount</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody id="transactions-list"></tbody>
        </table>
      </div>
    )
  }
  export default TransactionTable;
